import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { SignupComponent } from './signup/signup.component'; // Ajustez le chemin selon votre structure

const routes: Routes = [
  { path: '', redirectTo: '/signup', pathMatch: 'full' }, // Redirection vers la page d'inscription
  { path: 'signup', component: SignupComponent },
  // Définissez ici d'autres routes de votre application
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
